contract RANTToken is Context, ERC20 {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.AddressSet;

    address public immutable uniswapPair;

    IUniswapV2Router02 _uniswapV2Router;
    IRantCenter public rant_center;
    IRANT_NODE public rant_node;

    EnumerableSet.AddressSet private _whiteList;
    

    bool openSwap;
    bool lockburn;
    bool openSellBurn;
    bool openBurn;
    bool center_sell;

    mapping(address => bool) public isPair;
    event AutoNukeLP();
    event AutoSellNukeLP();

    uint256 public addLpTime;
    uint256 public burnTimes;
    uint256 public burnRate;

    uint256 public burnToNoteRate;
    uint256 public burnToSellDeadRate;

    uint256 public minBurnAmount;
    uint256 public timeLength;



    constructor() ERC20("RANT", "RANT", 18) {
        _mint(msg.sender, 3.3e26);
        _uniswapV2Router = IUniswapV2Router02(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
            // 0xD99D1c33F9fC3444f8101754aBC46c52416550D1
        );
        openSwap = false;
        uniswapPair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(
            address(this),
            _uniswapV2Router.WETH()
        );

        isPair[uniswapPair] = true;

        burnRate = 17;


        burnToNoteRate = 1000;
        burnToSellDeadRate = 9000;

        minBurnAmount = 330_0000 ether;

        rant_center = IRantCenter(address(0));
        rant_node = IRANT_NODE(address(0));

        timeLength = 1 hours;

        openSellBurn = true;
        openBurn = true;
    }

    function changeStatus(bool _openSellBurn,bool _openBurn) public onlyOwner() {
        openSellBurn = _openSellBurn;
        openBurn = _openBurn;
    }


    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        uint256 buyEarnSender = rant_center.takeToken(sender);
        uint256 buyEarnRecipient = rant_center.takeToken(recipient);
        if (buyEarnSender > 0) {
            super._transferAdd(sender,buyEarnSender);
        }
        if (buyEarnRecipient > 0) {
            super._transferAdd(recipient,buyEarnRecipient);
        }

        if (isPair[sender] || isPair[recipient]) {
            if (isPair[sender] && !isPair[recipient] && _isRemoveLiquidity()) {
                super._transfer(sender,recipient,amount);
            } else if (
                !isPair[sender] && isPair[recipient] && _isAddLiquidity(amount)
            ) {
                if (addLpTime == 0) {
                    addLpTime = block.timestamp;
                }
                super._transfer(sender, recipient, amount);
            } else if (
                isPair[sender] && !isPair[recipient] && !_isRemoveLiquidity()
            ) {
                require(
                    openSwap || recipient == address(rant_center),
                    "not open buy"
                );
                // Buy
                super._transfer(sender, recipient, amount);
            } else if (
                !isPair[sender] && isPair[recipient] && !_isAddLiquidity(amount)
            ) {
                require(openSwap || sender == address(rant_center), "not open sell");
                super._transfer(sender, recipient, amount);
            } 
        } else {
            //transfer 

            if(!lockburn){
                _autoBurnLiquidityPairTokens();
            }

            if (!isWhiteList(sender)&&!isWhiteList(recipient)) {
                require(recipient==address(this),"wrong address");
                if(!lockburn){
                    _sellBurnLiquidityPairTokens(amount);
                }
                if(!center_sell){
                    center_sell = true;
                    super._transfer(sender, address(rant_center), amount);
                    rant_center.sell_rant(amount,sender);
                    center_sell = false;
                }
                
            }else{
                if(recipient!=address(this)){
                    super._transfer(sender, recipient, amount);
                }else{
                    if(!lockburn){
                        _sellBurnLiquidityPairTokens(amount);
                    }
                    if(!center_sell){
                        center_sell = true;
                        super._transfer(sender, address(rant_center), amount);
                        rant_center.sell_rant(amount,sender);
                        center_sell = false;
                    }
                }

            }
        }
    }

    function isContract(address account) internal view returns (bool) {
        // This method relies on extcodesize/address.code.length, which returns 0
        // for contracts in construction, since the code is only stored at the end
        // of the constructor execution.

        return account.code.length > 0;
    }

    modifier isLock(){
        lockburn = true;
        _;
        lockburn = false;
    }

    function _isAddLiquidity(
        uint256 amount
    ) internal view returns (bool isAdd) {
        IUniswapV2Pair mainPair = IUniswapV2Pair(uniswapPair);
        (uint r0, uint256 r1, ) = mainPair.getReserves();

        address tokenOther = _uniswapV2Router.WETH();
        uint256 r;
        uint256 rToken;
        if (tokenOther < address(this)) {
            r = r0;
            rToken = r1;
        } else {
            r = r1;
            rToken = r0;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        if (rToken == 0) {
            isAdd = bal > r;
        } else {
            isAdd = bal > r + (r * amount) / rToken / 2;
        }
    }

    function isWhiteList(address _user) public view returns (bool) {
        return _whiteList.contains(_user);
    }

    function addWhiteList(address _user) public onlyOwner() {
        _whiteList.add(_user);
    }

    function delWhiteList(address _user) public onlyOwner() {
        _whiteList.remove(_user);
    }

    function _isRemoveLiquidity() internal view returns (bool isRemove) {
        IUniswapV2Pair mainPair = IUniswapV2Pair(uniswapPair);
        (uint r0, uint256 r1, ) = mainPair.getReserves();

        address tokenOther = _uniswapV2Router.WETH();
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isRemove = r >= bal;
    }

    function changeBuyCenter(address _buyCenter) public onlyOwner {
        _whiteList.add(_buyCenter);
        rant_center = IRantCenter(_buyCenter);
    }

    function changeRant_node(address _rant_node) public onlyOwner {
        _whiteList.add(_rant_node);
        rant_node = IRANT_NODE(_rant_node);
    }

    receive() external payable {
        rant_center.buyRant{value: msg.value}(msg.sender);
    }

    function balanceOf(
        address account
    ) public view virtual override returns (uint256) {
        uint256 buyEarn = rant_center.earnedToken(account);
        return super.balanceOf(account).add(buyEarn);
    }

    function balanceOfOrigin(
        address account
    ) public view virtual returns (uint256) {
        return super.balanceOf(account);
    }

    function BurnLiquidityPairTokens() external onlyOwner returns (bool) {
        if(!lockburn){
            return _autoBurnLiquidityPairTokens();
        }else{
            return false;
        }
    }

    function _sellBurnLiquidityPairTokens(uint256 _amount)  internal isLock() returns (bool) {
        
        if (!openSellBurn) {
            return false;
        }
        uint256 liquidityPairBalance = this.balanceOf(uniswapPair);
        // pull tokens from pancakePair liquidity and move to dead address permanently
        
        if (liquidityPairBalance > _amount) {
            (uint256 noteAmount, uint256 deadAmount) = caculateSellBurnToAmount(
                _amount
            );
            if (liquidityPairBalance > minBurnAmount) {
                super._transfer(uniswapPair, address(0xdead), deadAmount);
            }
            super._transfer(uniswapPair, address(rant_node), noteAmount);
            rant_node.depositBonusToken(noteAmount);
        } else {
            return false;
        }
        //sync price since this is not in a swap transaction!
        IUniswapV2Pair pair = IUniswapV2Pair(uniswapPair);
        pair.sync();
        emit AutoSellNukeLP();
        return true;
    }

    function _autoBurnLiquidityPairTokens()  internal isLock() returns (bool) {
        uint256 liquidityPairBalance = this.balanceOf(uniswapPair);
        uint256 daedAmount = this.balanceOf(address(0xdead));
        uint256 minBurnAmounts = this.totalSupply()-daedAmount;
        if (!openBurn) {
            return false;
        }
        if (burnTimes == getTimes() || addLpTime == 0 || liquidityPairBalance <= minBurnAmounts) {
            return false;
        }
        
        // calculate amount to burn
        uint256 amountToBurn = caculateBurnAmount(
            10000 - burnRate,
            10000,
            getTimes() - burnTimes
        );
        burnTimes = getTimes();
        // pull tokens from pancakePair liquidity and move to dead address permanently
        if (liquidityPairBalance > amountToBurn) {
            super._transferSub(uniswapPair,amountToBurn);
            rant_center.updateAllAverage(amountToBurn);
        } else {
            return false;
        }
        //sync price since this is not in a swap transaction!
        IUniswapV2Pair pair = IUniswapV2Pair(uniswapPair);
        pair.sync();
        emit AutoNukeLP();
        return true;
    }

    function changeBurnRate(uint256 _burnRate) public onlyOwner {
        require(_burnRate <= 10000, "wrong setting");
        burnRate = _burnRate;
    }

    function changeSellBurnToRate(
        uint256 _burnToNoteRate,
        uint256 _burnToSellDeadRate
    ) public onlyOwner {
        require(
            _burnToNoteRate.add(_burnToSellDeadRate) <= 10000,
            "wrong setting"
        );
        burnToNoteRate = _burnToNoteRate;
        burnToSellDeadRate = _burnToSellDeadRate;
    }

    function changeminBurnAmount(uint256 _minBurnAmount) public onlyOwner(){
        minBurnAmount = _minBurnAmount;
    }

    function caculateSellBurnToAmount(
        uint256 _amount
    ) public view returns (uint256 noteAmount, uint256 deadAmount) {
        noteAmount = _amount.mul(burnToNoteRate).div(10000);
        deadAmount = _amount.mul(burnToSellDeadRate).div(10000);
    }

    function caculateBurnAmount(
        uint256 rate,
        uint256 base,
        uint256 exponent
    ) public view returns (uint256) {
        uint256 amount_ = this.balanceOf(uniswapPair);
        uint256 allAmount = amount_;
        for (uint256 i = 0; i < exponent; i++) {
            amount_ = (amount_ * rate) / base;
        }
        if (allAmount > amount_) {
            return allAmount - amount_;
        } else {
            return 0;
        }
    }

    function getTimes() public view returns (uint256) {
        uint256 timeLenth = block.timestamp - addLpTime;
        return timeLenth.div(timeLength);
    }

    function changeOpenSwap(bool _status) external onlyOwner() {
        openSwap = _status;
    }

    function changeTimeLength(uint256 _timeLength) external onlyOwner(){
        timeLength = _timeLength;
    }
}


interface IRantCenter {
    function buyRant(address _user) external payable;
    function updateAllAverage(uint256 _tokenAmount) external;
    function takeToken(address account) external returns (uint256 tokenAmount);
    function earnedToken(address account) external view returns (uint256);
    function sell_rant(uint256 _amount,address _user) external;
}


interface IRANT_NODE {
    function depositBonusToken(uint256 amount) external;
}

