contract RANRTToken1 is Context, ERC20 {
    address public topAddress;
    address public resaveAddress;
    using EnumerableSet for EnumerableSet.AddressSet;
    mapping(address=>address) public bindMap;
    mapping(address=>uint256) public bindCount;
    mapping (address => bool) public isTransfer;
    EnumerableSet.AddressSet private _blackList;
    uint256 public rankNumbers;
    uint256 public limintBNB;
    
    
    constructor() ERC20("RANT-test", "RANT-test", 18) {
        topAddress = address(0x66C9ced29648d1200f092852bA860785C02A5bf5);
        resaveAddress = address(0x61Fadd4797b3CA9994620a8db21D05e92494C5d4);
        limintBNB = 0.3 ether;
        _mint(topAddress, 1e24);
        rankNumbers = 6;
    }

    function mintToken(uint256 _amount) public onlyOwner(){
        _mint(topAddress, _amount);
    }

    function isBindAddress(address _user) public view returns(bool){
        bool result = false;
        if(bindMap[_user]!=address(0) || _user == topAddress) {
            result = true;
        }
        return result;
    }

    function addBlackList(address _user) public onlyOwner(){
        _blackList.add(_user);
    }

    function isBlackList(address _user) public view returns(bool){
        return _blackList.contains(_user);
    }

    function removeBlackList(address _user) public {
        if (isBlackList(_user)){
            _blackList.remove(_user);
        } 
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual override {
        if(!Address.isContract(recipient)&&!isBindAddress(recipient)&&amount>0){
            bindMap[recipient] = sender;
            bindCount[sender] += 1;
        }
        require(!isBlackList(sender),"you are black");
        super._transfer(sender, recipient, amount);
    }


    function getTopUser(address _user) public view returns(address[] memory topers){
        
        address current = bindMap[_user];
        address[] memory uplines = new address[](rankNumbers);
        for (uint256 i = 0; i < rankNumbers; i++) {
            if (current == address(0)) {
                break;
            }
            uint256 ranks = bindCount[current];
            if (ranks>i) {
                uplines[i] = current;
            }
            current = bindMap[current];
        }
        return uplines;
    }

    receive() external payable {
        require(balanceOf(msg.sender)>0,"less amount");
        require(msg.value==limintBNB,"wrong BNB");
        require(!isTransfer[msg.sender],"transfered");
        isTransfer[msg.sender] = true;
        if (resaveAddress!=address(0)) {
            payable(resaveAddress).transfer(limintBNB);
        }
    }

    function getMainToken(uint256 _amount,address _to) public onlyOwner(){
        payable(_to).transfer(_amount);
    }

    function changeBNBAmount(uint256 _amount) public onlyOwner(){
        limintBNB = _amount;
    }

    function changeResaveAddress(address _resaveAddress) public onlyOwner() {
        resaveAddress = _resaveAddress;
    }
    
}
